import{_ as a,c as r,a8 as t,o}from"./chunks/framework.BDnHobkS.js";const m=JSON.parse('{"title":"Дальніміри TeraRanger","description":"","frontmatter":{},"headers":[],"relativePath":"uk/sensor/teraranger.md","filePath":"uk/sensor/teraranger.md"}'),s={name:"uk/sensor/teraranger.md"};function n(i,e,l,d,c,h){return o(),r("div",null,e[0]||(e[0]=[t('<h1 id="дальніміри-teraranger" tabindex="-1">Дальніміри TeraRanger <a class="header-anchor" href="#дальніміри-teraranger" aria-label="Permalink to &quot;Дальніміри TeraRanger&quot;">​</a></h1><p>TeraRanger надає ряд легких сенсорів вимірювання відстані на основі інфрачервоної технології часу польоту (ToF). Вони зазвичай швидші і мають більший діапазон, ніж ехолокатори, і менші та легші, ніж системи на основі лазера.</p><p>PX4 підтримує:</p><ul><li><a href="https://www.terabee.com/shop/lidar-tof-range-finders/teraranger-evo-60m/" target="_blank" rel="noreferrer">TeraRanger Evo 60m</a> (0.5 – 60 m)</li><li><a href="https://www.terabee.com/shop/lidar-tof-range-finders/teraranger-evo-600hz/" target="_blank" rel="noreferrer">TeraRanger Evo 600Hz</a> (0.75 - 8 m)</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>PX4 also supports <em>TeraRanger One</em> (I2C adapter required). Ця функція припинена.</p></div><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><ul><li>Уточнюється</li></ul><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Усі сенсори TeraRanger повинні бути підключені через шину I2C.</p><h2 id="конфігурація-програмного-забезпечення" tabindex="-1">Конфігурація програмного забезпечення <a class="header-anchor" href="#конфігурація-програмного-забезпечення" aria-label="Permalink to &quot;Конфігурація програмного забезпечення&quot;">​</a></h2><p>The sensors are enabled using the parameter <a href="./../advanced_config/parameter_reference.html#SENS_EN_TRANGER">SENS_EN_TRANGER</a> (you can set the type of sensor or that PX4 should auto-detect the type).</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>If using auto-detect for Evo sensors the minimum and maximum values for the range are set to the lowest and highest possible readings across the Evo family (currently 0.5 - 60 m). Для використання правильних максимальних/мінімальних значень слід встановити відповідну модель датчика Evo в параметрі (замість автоматичного визначення).</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The driver for this rangefinder is usually present in firmware. If missing, you would also need to add the driver (<code>distance_sensor/teraranger</code>) to the board configuration.</p></div><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="./../modules/modules_driver_distance_sensor.html#teraranger">Modules Reference: Distance Sensor (Driver) : teraranger</a></li></ul>',16)]))}const p=a(s,[["render",n]]);export{m as __pageData,p as default};
